    def add_ticket(self, ticket):
        self.tickets.append(ticket)

    def search_tickets(self, **kwargs):
        results = self.tickets[:]
        for key, value in kwargs.items():
            if key == 'status':
                results = [ticket for ticket in results if ticket.status == value]
            elif key == 'priority':
                results = [ticket for ticket in results if ticket.priority == value]
            elif key == 'customer_info':
